import React from 'react';
import './Login.css';

export default function Login() {
    return (
        <div className="loginform">
            <h1>Login</h1>
            <input type="text" placeholder="Username"/>
            <input type="password" placeholder="Password"/>
            <button>Submit</button>
        </div>
    )
}
